import React, { useState } from 'react'

function Profile() {

  const [area,setArea] = useState(1000);

//   function CollectArea(e){
//  let value=e.target.value;
//    console.log(value);
//    setArea(area-value);
//   }

  function handleSubmit(e){

    e.preventDefault();
    let value=parseInt(e.target.value);
   console.log(value);
   setArea(area-(value))
  
  }

  return (
    <div>
      
        <div>

        </div>
    
    <div className='add-crop'>
       <h1>Add Crop</h1>
       <form onSubmit={handleSubmit}>
       <select>
            <option value=''>onion</option>
            <option value='graps'>graps</option>
            <option value='mango'>mango</option>
            <option value='banna'>banna</option>
            <option value='orange'>orange</option>
         </select>
         <br></br> <br></br>
         <label>Upload gst bill for crop</label><br></br>
         <input type='file'></input>

         <br></br> <br></br>
         <label>Upload image of crop</label><br></br>
         <input type='file'></input>
         
         <br></br> <br></br>
         <label>Enter Area of crop aproximately in acers</label><br></br>
         <input type='text' ></input>
         
         <br></br><br></br>
         <input type='submit'></input>
    
       </form>
       <h1>{area}</h1>
    
    </div>

    </div>
  )
}

export default Profile
